import './projects.css'

const projects = () => {
    const projects = [
        {
            title: 'Java Class Assignments',
            description: 'Developed several Java applications focusing on OOP principles and data structures.',
            class: 'Java Programming'
        },
        {
            title: 'Python Class Projects',
            description: 'Implemented various Python scripts and applications, including data analysis with pandas and NumPy.',
            class: 'Advanced Python Programming'
        },
        {
            title: 'Database Management Systems',
            description: 'Designed and managed SQL databases, optimizing queries and designing schemas for efficiency.',
            class: 'Database Systems'
        },
        {
            title: 'Machine Learning Models',
            description: 'Built and trained machine learning models using scikit-learn and TensorFlow for predictive analysis.',
            class: 'Introduction to Machine Learning'
        },
        {
            title: 'C++ and Software Design Patterns',
            description: 'Created applications using C++ and applied various software design patterns to solve design problems.',
            class: 'Software Design and Patterns'
        },
        {
            title: 'Big Data Analysis with Hadoop and PySpark',
            description: 'Conducted big data processing and analytics using the Hadoop ecosystem and PySpark framework.',
            class: 'Big Data Technologies'
        },
        {
            title: 'Chemical Engineering Capstone Project',
            description: 'Collaborated on a comprehensive capstone project addressing real-world chemical engineering challenges.',
            class: 'Chemical Engineering Design'
        },
        // Add more projects as needed
    ];

    return (
        <section id="previous-work">
            <h2>Previous Work and Assignments</h2>
            <div className="previous-work-container">
                {projects.map((project, index) => (
                    <div key={index} className="project-card">
                        <h3>{project.title}</h3>
                        <p>{project.description}</p>
                        <span className="class-name">{project.class}</span>
                    </div>
                ))}
            </div>
        </section>
    );
}

export default projects
